import { Link } from "react-router-dom";

function EventsPage(){
    return 
    (
        <>
            <h1>EventsPage</h1>
            <ul>
                <li><Link to='/events/event-1'>Event 1</Link></li>
                <li><Link to='/events/event-2'>Event 2</Link></li>
                <li><Link to='/events/event-3'>Event 3</Link></li>

            </ul>
        </>

    );
}

export default EventsPage;
